import React from 'react';
import './Slider.css';

const slidesInfo = [
    {
        src: "https://static.wixstatic.com/media/53333b_7da235b918554fa18ed57dd5a65048c6.jpg",
        alt: "Proyecto 1",
        desc: "Proyecto 1"
    },
    {
        src: "https://static.wixstatic.com/media/53333b_863828d3c6894243bc56f6e4a2e621ca~mv2.png",
        alt: "Proyecto 1",
        desc: "Proyecto 1"
    },
    {
        src: "https://static.wixstatic.com/media/c74c32c344c44f35b871382c99feabe4.jpg",
        alt: "Proyecto 1",
        desc: "Proyecto 1"
    }
]

const slides = slidesInfo.map(slide => (
    <div className="slide-container">
        <img src={slide.src} alt={slide.alt} />
        <div className="slide-desc">
            <span>{slide.desc}</span>
        </div>
    </div>
))

export default slides;
